import React from "react";
import "./services.css";
import icon1 from "../../assets/ICON3.png";

function Card(props) {
  return (
    <>
      <div className="card">
        <img src={props.img} alt="" />
        <h3>{props.heading}</h3>
        <div className="bars"></div>
      </div>
    </>
  );
}

const Services = () => {
  return (
    <div>
      <div className="services">
        <div className="serv-top">
          <div>
            <div className="bar"></div>
            <span>What we do</span>
          </div>
          <h2>Our Services</h2>
          <p>Lorem ipsum is a placeholder.</p>
        </div>
        <div className="card-container">
          <Card img={icon1} heading={"Finencial Management"} />
        </div>
        <div className="serv-end"></div>
      </div>
    </div>
  );
};
export default Services;
